import React from "react";
const Index = () => {
  return (
    <>
      <h1>This is parent component</h1>
      <ChildComponent />
    </>
  );
};
const ChildComponent = () => {
  return (
    <>
      <h1>This is ChildComponent</h1>
    </>
  );
};
const SubChildComponent = () => {
  return (
    <>
      <h1>This is SubChildComponent</h1>
    </>
  );
};
export default Index;
